const Profile =() =>{

    return(
        <div className="container fixed-top-padding">
            <Nav/>
            <div className="row">
                <div className="col-lg-4">
                    <div className="card">
                        <div className="card-body">
                            <div className="media">
                                
                            </div>
                        </div>

                    </div>
                </div>
                <div className="col-lg-8">Profile</div>
            </div>

        </div>
    )
}

export default Profile;
